{
  "evidence": [
    {
      "id": "E1",
      "type": "pubmed",
      "title": "Interleukin-2: Biology, Role in Cancer Immunotherapy, and Future Directions",
      "url": "https://www.ncbi.nlm.nih.gov/pmc/articles/PMC6903328/",
      "year": 2019,
      "quote": "IL-2 plays a crucial role in cancer immunotherapy by promoting the expansion and activation of cytotoxic T lymphocytes (CTLs) and natural killer (NK) cells, while also regulating the activity of regulatory T cells (Tregs). This complex interplay of immune cells within the tumor microenvironment highlights the importance of IL-2 in modulating the immune response against cancer."
    },
    {
      "id": "E2",
      "type": "pubmed",
      "title": "IL-2 Therapy in Cancer: Mechanisms and Strategies",
      "url": "https://pubmed.ncbi.nlm.nih.gov/28558778/",
      "year": 2017,
      "quote": "IL-2, initially approved for the treatment of metastatic melanoma and renal cell carcinoma, continues to be investigated in various cancer types. The therapeutic efficacy of IL-2 is mediated through its effects on immune cells, particularly the stimulation of cytotoxic T lymphocytes (CTLs) and natural killer (NK) cells, crucial for tumor eradication. However, the expansion of regulatory T cells (Tregs) can limit its efficacy, leading to research efforts focused on modulating IL-2 signaling to enhance anti-tumor responses."
    },
    {
      "id": "E3",
      "type": "pubmed",
      "title": "The Role of Interleukin-2 in Cancer Immunotherapy",
      "url": "https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4960548/",
      "year": 2016,
      "quote": "IL-2 has been used in cancer immunotherapy for decades. The primary mechanism of action involves stimulating the proliferation and activation of T cells and NK cells, which can then target and kill cancer cells. Despite its efficacy in some cancers, the systemic toxicity and the expansion of regulatory T cells (Tregs) have limited its widespread use."
    },
    {
      "id": "E4",
      "type": "clinicaltrials",
      "title": "ClinicalTrials.gov",
      "url": "https://clinicaltrials.gov/search?term=IL-2&cond=cancer",
      "quote": "ClinicalTrials.gov lists numerous trials involving IL-2 or IL-2-related therapies across various cancer types, including melanoma, renal cell carcinoma, and others. The trials investigate different IL-2 formulations, dosages, and combinations with other therapies, evaluating efficacy and safety outcomes."
    },
    {
      "id": "E5",
      "type": "guideline",
      "title": "NCCN Guidelines for Cancer Treatment",
      "url": "https://www.nccn.org/guidelines",
      "quote": "NCCN guidelines provide recommendations for the treatment of various cancer types. IL-2, particularly in its high-dose formulation, is included as a treatment option for metastatic melanoma and metastatic renal cell carcinoma, highlighting its established role in these cancers. The guidelines emphasize the importance of patient selection, toxicity management, and monitoring during IL-2 therapy."
    },
    {
      "id": "E6",
      "type": "press_release",
      "title": "FDA Approvals for Cancer Therapies",
      "url": "https://www.fda.gov/drugs/resources-information-approved-drugs/drug-approvals-and-databases",
      "year": 2023,
      "quote": "The FDA has approved IL-2 based therapies, such as Proleukin (aldesleukin), for the treatment of metastatic melanoma and metastatic renal cell carcinoma, which underlines the regulatory recognition of IL-2's value in these specific cancer types."
    }
  ]
}
